					WaitForMove(TreePiece[i+1],z_axis)
					EndPointReservoir[#EndPointReservoir+1]=EndPiece[i]
				end
				Sleep(1)
				
			end
		end
	end
	
	
	return false	
end

function divcompare(it,val,pos)
	if math.abs(val-pos)>500 then Spring.Echo("Node behaving badly"..it-1) end	
end


